import React from 'react';

import Img1 from 'assets/images/home/1.png';

class List extends React.Component {
  constructor(props) {
    super(props);
  }
  render() {

    return (
      <div>
        <img src = {Img1} style = {{width:"100%"}} />
      </div>
    );
  }
}


export default List;
